pub trait GameDataExt {
    fn get_value_by_key(&self, key: &str) -> Result<&str>;
}

impl<const LENGTH: usize> GameDataExt for [[&'static str; 2]; LENGTH] {
    fn get_value_by_key(&self, key: &str) -> Result<&str> {
        self.par_iter()
            .find_first(|[k, _]| key == *k)
            .map(|[_, v]| *v)
            .context("Failed to find game_data value")
    }
}
